        <div className="search-box">
            <input type="text" id='search' 
            onChange={e=>{{props.locData}(e.target.value)}} 
            onKeyDown = {()=>props.searchLocat}
            placeholder='Search here' />
        </div>
    </div>
  )
}

export default Top;
